    display:flex;
    img{
        width: 20vw;
    }
`
function Logotipo() {
    return (
        <LogotipoStyle>
            <img src={Logo} alt=""/>
            <h1>
            Consertos Computadores e Celulares
            </h1>
        </LogotipoStyle>
    );
}
export default Logotipo;
